import React from 'react';
export default function Homepage (props){
 return (
   <div>
     <h1>HomePage</h1>
     <div class="sketchfab-embed-wrapper">
    <iframe title="A 3D model" width="640" height="480" src="https://sketchfab.com/models/5d5fa4bc4ad648b3ab253dbff7136305/embed?preload=1&amp;ui_controls=1&amp;ui_infos=1&amp;ui_inspector=1&amp;ui_stop=1&amp;ui_watermark=1&amp;ui_watermark_link=1" frameborder="0" allow="autoplay; fullscreen; vr" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>
   
</div>


    


   </div>
 );
}
